molecule = ''''''

# replacements = '''H => HO
# H => OH
# O => HH'''

# molecule = 'HOH'

replacements = replacements.splitlines()
replacements = [line.split() for line in replacements]
molecules = set()

for rule in replacements:
    pattern = re.compile(f'{rule[0]}')
    for i in pattern.finditer(molecule):
        s,e = i.span()
        m = molecule[:s] + rule[2] + molecule[e:]
        molecules.add(m)
print(len(molecules))

